import { styled} from "styled-components";

const Container = styled.div`
    position:relative;
    height: 720px;
    padding-top: 20px;
    padding-left: 20px;
    top: 100px;
    left:20%;
    width:78%;
    display: flex;
    flex-direction: column;
    flex-wrap: wrap;
    justify-content: flex-start;
    align-content: center;

`;

export default Container;
